;function setReadStatus(articleURL) {
  let readArticles = window.localStorage.getItem("readArticles").split(",");

  if (!readArticles.includes(articleURL)) {
    readArticles.push(articleURL);
    window.localStorage.setItem("readArticles", readArticles);
  }
}

function getReadStatus(articleURL) {
  const readArticles = window.localStorage.getItem("readArticles").split(",");

  if (readArticles.includes(articleURL)) {
    return true;
  } else {
    return false;
  }
}

function init() {
  if (!window.localStorage.getItem("readArticles")) {
    window.localStorage.setItem("readArticles", []);
  }

  // Add current page to readArticles
  setReadStatus(window.location.href);

  // Initialize read indicators
  document.querySelectorAll(".article-selection .card").forEach((card) => {
    const readButton = card.querySelector(".readButton");
    const indicator = card.querySelector(".indicator");
    const articleURL = indicator.getAttribute("data-url");

    if (getReadStatus(articleURL)) {
      indicator.title = "Read";
      readButton.title = "Read";

      indicator.classList.remove("unread");
      indicator.classList.add("read");
    }
  });

  // Article Anchors
  document
    .querySelectorAll(".card .headline > a, .card a.image, a.readButton")
    .forEach((anchor) => {
      anchor.addEventListener("click", () => {
        const articleURL = anchor.href;

        // Set article as read
        setReadStatus(articleURL);

        // Set indicators to read
        const indicators = document.querySelectorAll(
          `.indicator[data-url="${articleURL}"]`
        );

        indicators.forEach((indicator) => {
          indicator.classList = "indicator read";
          indicator.title = "Read";
        });

        // Set buttons to read
        const readButtons = document.querySelectorAll(
          `a.readButton[href="${articleURL}"]`
        );
        readButtons.forEach((button) => {
          button.title = "Read";
        });
      });
    });
}

