function animateHeadline() {
  const masks = [
    "comma-open",
    "we-w",
    "we-e-tail",
    "we-char-e",
    "will-w",
    "will-char-i",
    "will-l1",
    "will-l2",
    "will-i-dot",
    "always-a1",
    "always-l",
    "always-w",
    "always-a2-up",
    "always-char-a2",
    "always-y",
    "always-s",
    "outlive-o",
    "outlive-u",
    "outlive-t-up",
    "outlive-t-down",
    "outlive-l",
    "outlive-char-i",
    "outlive-ve",
    "outlive-t-cross",
    "outlive-i-dot",
    "the-t-down",
    "the-h",
    "the-e",
    "the-t-cross",
    "people-p1-down",
    "people-char-p1",
    "people-e1",
    "people-o-up",
    "people-char-o",
    "people-p2-down",
    "people-char-p2",
    "people-l",
    "people-e2",
    "who-w",
    "who-h",
    "who-o-up",
    "who-char-o",
    "hate-h",
    "hate-a-up",
    "hate-char-a",
    "hate-t-up",
    "hate-t-down",
    "hate-e",
    "hate-t-cross",
    "us-u",
    "us-s",
    "comma-close",
  ];

  let animDelay = 0;

  masks.forEach((mask, index, masksArray) => {
    const id = `#mask-${mask}`;
    let path = document.querySelector(id);
    const length = path.getTotalLength();

    path.style.strokeDasharray = length + 0.1;
    path.style.strokeDashoffset = length + 0.1;
    path.style.fill = "none";
    path.style.stroke = "white";
    path.style.strokeMiterlimit = "10";

    let animLength = Number(length / 300);

    if (mask.includes("comma")) {
      animLength = 0.5;
    } else if (mask.includes("dot") || mask.includes("cross")) {
      animLength = 0.3;
    }

    path.style.animation = `strokeOffset ${animLength}s linear ${animDelay}s 1 forwards`;
    animDelay += animLength;
  });
}

