function animateSectionBreak() {
  const svgPaths = document.querySelectorAll(
    ".section-break svg path, .section-break svg line"
  );
  svgPaths.forEach((path) => {
    const length = path.getTotalLength();
    path.style.strokeDasharray = length;
    path.style.strokeDashoffset = length;

    if (path.id == "line" || path.id == "circle") {
      path.style.animationDelay = "2s";
    }
  });
}

function initSectBreaks() {
  try {
    const sectionBreaks = document.querySelectorAll(".section-break");

    sectionBreaks.forEach((section) => {
      section.innerHTML += sectBreak;
    });

    animateSectionBreak();
    window.addEventListener("scroll", checkScroll);
  } catch (e) {
    console.log(e);
    return;
  }
}

function checkScroll() {
  // Section Divider animation
  let windowHeight = window.innerHeight;
  const sectionBreaks = document.querySelectorAll(".section-break");

  sectionBreaks.forEach((section) => {
    const sectionMasks = section.querySelectorAll("path, line");

    sectionMasks.forEach((mask) => {
      let positionFromTop = section.getBoundingClientRect().top;

      // Fade-in section break when scrolled into view
      if (positionFromTop - windowHeight <= -40) {
        mask.classList.add("section-break-reveal");
      }
    });
  });

  // Picture animations
  const animElements = document.querySelectorAll(".animated");

  animElements.forEach((element) => {
    const positionFromTop = element.getBoundingClientRect().top;
    const animClass = element.getAttribute("data-anim-class");

    if (positionFromTop - windowHeight <= -100) {
      element.classList.add(animClass);
    } else if (positionFromTop - windowHeight > -40) {
      element.classList.remove(animClass);
    }

    const image = element.parentElement.querySelector("img");

    if (element.localName == "figcaption") {
      if (positionFromTop - windowHeight <= -100) {
        image.style.borderRadius = "10px 10px 0 0";
      } else if (positionFromTop - windowHeight > -40) {
        image.style.borderRadius = "10px";
      }
    }
  });

  // Quote animation
  const quoteCard = document.querySelector(".quote .glass-card");
  const quoteContainer = document.querySelector(".quote .headline");
  let positionFromTop = quoteCard.getBoundingClientRect().top;

  if (
    quoteContainer.style.display == "none" &&
    positionFromTop - windowHeight <= -200
  ) {
    quoteContainer.style.display = "flex";
  } else if (
    quoteContainer.style.display == "flex" &&
    positionFromTop - windowHeight > windowHeight
  ) {
    quoteContainer.style.display = "none";
  }
  // Show/hide nav
  const scrollContainer = document.querySelector(".scroll-container");

  if (scrollContainer.getBoundingClientRect().top <= 0) {
    const nav = document.querySelector("nav");
    nav.style.backgroundColor = "transparent";
    slug.style.display = "none";
  }

  const quoteFull = document.querySelector(".quote-2");
  const quoteFullContainer = quoteFull.querySelector(".container");
  positionFromTop = quoteFull.getBoundingClientRect().top;

  if (
    quoteFullContainer.style.display == "none" &&
    positionFromTop - windowHeight <= -300
  ) {
    quoteFullContainer.style.display = "flex";
  } else if (
    quoteFullContainer.style.display == "flex" &&
    positionFromTop - windowHeight > windowHeight
  ) {
    quoteFullContainer.style.display = "none";
  }
}

function typeHeader() {
  const headline = document.querySelector("header .headline-container");
  const headlineSpan = headline.querySelector("span");
  const text = "‘We will always outlive the people who hate us’";
  const cursorContainer = headline.querySelector(".cursorContainer");

  let index = 0;
  let timer = setInterval(() => {
    if (index < text.length) {
      const char = document.createElement("span");
      char.innerHTML = text.charAt(index++);
      headlineSpan.insertBefore(char, cursorContainer);
    } else {
      clearInterval(timer);

      setTimeout(() => {
        headline.querySelector(".cursor").style.opacity = "0";
      }, 4500);
    }
  }, 85);
}

// Image Links
document.querySelectorAll(".image-link").forEach((link) => {
  const linkedElement = document.querySelector(
    `[data-image-link="${link.getAttribute("data-image-link")}"]`
  );
  const linkedImage = linkedElement.querySelector("img");

  const linkedCaption = linkedElement.querySelector("figcaption");

  link.addEventListener("mouseenter", () => {
    const isCaptionVisible = linkedCaption.classList.contains("animate-in");

    if (isCaptionVisible) {
      linkedElement.classList.add("image-highlight");
    } else {
      linkedImage.classList.add("image-highlight");
    }
  });

  link.addEventListener("mouseleave", () => {
    linkedElement.classList.remove("image-highlight");
    linkedImage.classList.remove("image-highlight");
  });

  link.addEventListener("click", () => {
    const isCaptionVisible = linkedCaption.classList.contains("animate-in");

    if (isCaptionVisible) {
      linkedElement.classList.add("image-highlight");
    } else {
      linkedImage.classList.add("image-highlight");
    }

    setTimeout(() => {
      linkedElement.classList.remove("image-highlight");
      linkedImage.classList.remove("image-highlight");
    }, 3000);

    linkedElement.scrollIntoView({
      behavior: "smooth",
      block: "center",
    });
  });
});

